import base64
from PIL import Image
import cv2
# from StringIO import StringIO
# from io import StringIO
import numpy as np
from io import BytesIO

def readb64(base64_string):
	if "data:image" in str(base64_string):
		print("It is base64_string ")
	base64Str = base64_string.split(",")
	base64_string = base64Str[1]
	if len(base64_string) % 4:
		# not a multiple of 4, add padding:
		base64_string += '=' * (4 - len(base64_string) % 4)
	# print(base64_string)
	# sbuf = StringIO()
	sbuf = BytesIO()
	sbuf.write(base64.b64decode(base64_string))
	pimg = Image.open(sbuf)	
	return cv2.cvtColor(np.array(pimg), cv2.COLOR_RGB2BGR)

cvimg = readb64('data:image/png;base64,')
# cv2.imshow("Image",cvimg)
cv2.imwrite("static/temp/croppedimage.png",cvimg)
cv2.waitKey(0)